import Axios from 'axios'

export default class User{

    static async get(){
        return await Axios.get('http://localhost:5000/users')
    }

    static async show(id){
        return await Axios.get('http://localhost:5000/users/' + id)
    }

    static async destroy(ids){
        return await Axios.post('http://localhost:5000/users/mass-destroy', {ids})
    }

    static async update(data){
        return await Axios.put('http://localhost:5000/users/' + data._id, data)
    }

    static async store(data){
        return await Axios.post('http://localhost:5000/users/', data)
    }

}
